CREATE DEFINER=`ta`@`%` PROCEDURE `_restore`(IN databaseName VARCHAR(50), IN prefix VARCHAR(1))
    MODIFIES SQL DATA
BEGIN

                -- working copy table name
                DECLARE v_table TEXT;

                -- backup copy table name
                DECLARE z_table TEXT;

                -- SQL to restore database
                DECLARE delete_batch TEXT;
                DECLARE update_batch TEXT;
                DECLARE delete_qrtz TEXT;
                DECLARE del_records TEXT;
                DECLARE restore_records TEXT;

                -- Cursors
                DECLARE done INT DEFAULT FALSE;

                DECLARE batch_cursor CURSOR FOR
                  (SELECT table_name
                    FROM information_schema.tables
                    WHERE table_schema = databaseName COLLATE utf8_general_ci
                    AND table_name LIKE 'batch_%'                  -- only batch tables
                    AND table_name NOT LIKE 'batch_%_seq');        -- except batch sequence tables

                DECLARE qrtz_cursor CURSOR FOR
                  (SELECT table_name
                    FROM information_schema.tables
                    WHERE table_schema = databaseName COLLATE utf8_general_ci
                    AND table_name LIKE 'qrtz_%'                   -- only qrtz tables
                    AND table_name NOT LIKE 'qrtz_locks');         -- except qrtz locks

                DECLARE batch_seq_cursor CURSOR FOR
                  (SELECT table_name
                    FROM information_schema.tables
                    WHERE table_schema = databaseName COLLATE utf8_general_ci
                    AND table_name LIKE 'batch_%_seq');            -- only batch sequence tables tables

                DECLARE restore_cursor CURSOR FOR
                  (SELECT table_name
                    FROM information_schema.tables
                    WHERE table_schema = databaseName COLLATE utf8_general_ci
                    AND table_name NOT LIKE 'batch_%'              -- exclude batch tables
                    AND table_name NOT LIKE 'databasechangelog%'   -- exclude liquidbase tables
                    AND table_name NOT LIKE 'qrtz_%'               -- exclude job schedule tables
                    AND table_name NOT LIKE '_\_%'                 -- exclude existing backup tables
                    AND table_type NOT LIKE 'VIEW');               -- exclude views

                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

                BEGIN
                    SET delete_batch := '';
                    SET update_batch := '';
                    SET delete_qrtz := '';
                    SET del_records := '';
                    SET restore_records := '';

                    -- Disable the constraints
                    SET autocommit=0;
                    SET unique_checks=0;
                    SET foreign_key_checks=0;

                    -- Construct queries to DELETE batch tables
                    OPEN batch_cursor;
                    delete_batch_loop: LOOP
                        FETCH batch_cursor INTO v_table;
                        IF done THEN
                            LEAVE delete_batch_loop;
                        END IF;
                        SET delete_batch := CONCAT('DELETE FROM ', v_table, '; ');
                        SET @delete_batch_stmt := delete_batch;
                        PREPARE delete_batch_statement FROM @delete_batch_stmt;
                        EXECUTE delete_batch_statement;
                        DEALLOCATE PREPARE delete_batch_statement;
                    END LOOP delete_batch_loop;
                    CLOSE batch_cursor;
                    SET done = FALSE;

                    -- Update the batch sequence file
                    OPEN batch_seq_cursor;
                    update_batch_seq_loop: LOOP
                        FETCH batch_seq_cursor INTO v_table;
                        IF done THEN
                            LEAVE update_batch_seq_loop;
                        END IF;
                        SET update_batch := CONCAT('UPDATE ', v_table ,' SET id = 0;');
                        SET @update_batch_seq_stmt := update_batch;
                        PREPARE update_batch_seq_statement FROM @update_batch_seq_stmt;
                        EXECUTE update_batch_seq_statement;
                        DEALLOCATE PREPARE update_batch_seq_statement;
                    END LOOP update_batch_seq_loop;
                    CLOSE batch_seq_cursor;
                    SET done = FALSE;

                    -- Construct queries to DELETE qrtz tables
                    OPEN qrtz_cursor;
                    delete_qrtz_loop: LOOP
                        FETCH qrtz_cursor INTO v_table;
                        IF done THEN
                            LEAVE delete_qrtz_loop;
                        END IF;
                        SET delete_qrtz := CONCAT('DELETE FROM ', v_table, '; ');
                        SET @delete_qrtz_stmt := delete_qrtz;
                        PREPARE delete_qrtz_statement FROM @delete_qrtz_stmt;
                        EXECUTE delete_qrtz_statement;
                        DEALLOCATE PREPARE delete_qrtz_statement;
                    END LOOP delete_qrtz_loop;
                    CLOSE qrtz_cursor;
                    SET done = FALSE;

                    -- Construct queries to restore records that have been INSERTED, UPDATED, and DELETED
                    OPEN restore_cursor;
                    restore_loop: LOOP

                        FETCH restore_cursor INTO v_table;
                        IF done THEN
                          LEAVE restore_loop;
                        END IF;
                        SET z_table := CONCAT(prefix, '_', v_table);

                        -- Delete records that have been changed
                        SET del_records := CONCAT('DELETE FROM ', v_table,'; ');
                        SET @delete_records_stmt := del_records;
                        PREPARE del_records_statement FROM @delete_records_stmt;
                        EXECUTE del_records_statement;
                        DEALLOCATE PREPARE del_records_statement;

                        -- Restore records that have been deleted
                        SET restore_records := CONCAT('INSERT INTO ', v_table, ' (SELECT * FROM ', z_table, '); ');
                        SET @restore_records_stmt := restore_records;
                        PREPARE restore_records_statement FROM @restore_records_stmt;
                        EXECUTE restore_records_statement;
                        DEALLOCATE PREPARE restore_records_statement;
                        
                    END LOOP restore_loop;
                    CLOSE restore_cursor;
                    SET done = FALSE;
                    
                    -- Enable the constraints
                    SET foreign_key_checks=1;
                    SET unique_checks=1;
                    SET autocommit=1;
                    COMMIT;

                END;

            END ;;
