CREATE DEFINER=`ta`@`%` PROCEDURE `_sp_team_hierarchy_populate`(IN teamId BIGINT, IN companyId BIGINT)
    MODIFIES SQL DATA
BEGIN
                DECLARE childId BIGINT;
                DECLARE done INT DEFAULT FALSE;
                -- child team cursor
                DECLARE cur1 CURSOR FOR SELECT id FROM team t1
                    WHERE EXISTS (
                        SELECT 1 FROM team_ee_persona tp, team t2
                        WHERE t2.company_id = companyId
                        AND t2.id = teamId
                        AND t1.team_manager_persona_id = tp.ee_persona_id
                        AND t2.id = tp.team_id
                    )
                    AND t1.company_id = companyId;
                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

                SET max_sp_recursion_depth=255;

                -- insert the reference to itself.
                INSERT INTO team_hierarchy (company_id, ancestor_team_id, descendant_team_id)
                    SELECT t.company_id, t.id AS ancestor_team_id, t.id AS descenant_team_id
                    FROM team t
                    WHERE t.id = teamId
                    AND t.company_id = companyId
                    AND NOT EXISTS (
                        SELECT 1 FROM team_hierarchy th
                        WHERE th.company_id = companyId
                        AND th.ancestor_team_id = t.id
                        AND th.descendant_team_id = t.id
                    );

                OPEN cur1;

                read_loop: LOOP
                    FETCH cur1 INTO childId;
                    IF done THEN
                        LEAVE read_loop;
                    END IF;
                    -- we haven't detected a circular reference
                    IF (
                        SELECT NOT EXISTS (
                            SELECT 1 FROM team_hierarchy
                            WHERE company_id = companyId
                            AND ancestor_team_id = childId
                            AND descendant_team_id = teamId
                        )
                    ) THEN
                        -- insert records for children (that don't exist)
                        INSERT INTO team_hierarchy (company_id, ancestor_team_id, descendant_team_id)
                        SELECT t1.company_id, t1.ancestor_team_id, childId
                        FROM team_hierarchy t1
                        WHERE t1.company_id = companyId
                        AND t1.descendant_team_id = teamId
                        AND NOT EXISTS (
                            SELECT 1
                            FROM team_hierarchy t2
                            WHERE t2.company_id = companyId
                            AND t2.ancestor_team_id = t1.ancestor_team_id
                            AND t2.descendant_team_id = childId
                        );
                        CALL _sp_team_hierarchy_populate(childId, companyId);
                    END IF;

                END LOOP;

                CLOSE cur1;

            END ;;
DELIMITER ;
